import './App.css';

function App(){

    const handleInput = (e)=>{
        console.log(e.target.value);
    }

    return(
        <div className='container'>
            <form>
                <input type="text" onChange={handleInput}/>
                <button type='submit'>Add Todos</button>
            </form>
        </div>
    )
}
export default App;
